import './css/Home.css';
import React from 'react';

export default function Home() {
    return (
        <div>
            <div className='menu'>
                <p className='helloWorld'>안녕하세요, <br/>
                    저희는 CIAE입니다.</p>
                <p className='pageName'>홈 화면</p>
                <a href='src/components/Login/Login.js'><p className='logOut'>로그아웃</p></a>

            </div>
        </div>
    );
}
